CREATE TABLE `facilities` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `facilitycode` varchar(10) NOT NULL,
  `name` varchar(100) NOT NULL,
  `facilitytype` int(11) NOT NULL,
  `district` int(11) NOT NULL,
