  `parent` varchar(10) NOT NULL,
  `map` int(11) NOT NULL,
  `facility_dhis` tinyint(1) NOT NULL DEFAULT '0',
  `pill_count` tinyint(1) NOT NULL DEFAULT '1',
  `medical_number` tinyint(1) NOT NULL DEFAULT '0',
